import React from 'react';
import Navbar from '../Navbar/Navbar';
import Welcome from '../Welcome/Welcome';
import './Landing.css';

const landing = ( props ) => {
    return (
        <div>
            <Navbar></Navbar>
            <Welcome></Welcome>
        </div>
    );
};

export default landing;
